import React from 'react';

const Card = ( id, name, email) => {
	return (
		<div>
			<img alt='robot img' src={`/home/raj/Downloads/facebook.svg`}/>
			<div>
				<h2>${name}</h2>
				<p>${email}</p>
			</div>;
		</div>
	);
}

export default Card;
